import facebook from "../images/facebook.png";
import { SocialIcon } from "react-social-icons";
import youtube from "../images/youtube.png";

export default function Footer() {
  return (
    <div>
      <p id="social-header">Socials</p>
      <div id="logo-wrapper">
        <SocialIcon url="https://github.com/Chazzychouse" target="_blank" />

        <SocialIcon
          url="https://www.linkedin.com/in/chase-cartwright-98963823a/"
          target="_blank"
        />

        <SocialIcon
          url="https://www.facebook.com/chase.cartwright.3"
          target="_blank"
        />

        <SocialIcon
          url="https://www.youtube.com/channel/UCZqUuli_95AQZcdNHABbSIw"
          target="_blank"
        />
      </div>
    </div>
  );
}
